#!/usr/bin/env python3
"""
Eugene Intelligence - Merge Installer
Run this from ~/Desktop/eugene/ to add rebuild components.
Usage: python3 install_rebuild.py
"""
import base64, tarfile, io, os, sys

# Check we're in the right directory
if not os.path.exists("extraction/parsers/debt.py"):
    print("ERROR: Run this from ~/Desktop/eugene/")
    print(f"Current directory: {os.getcwd()}")
    sys.exit(1)

print("Eugene Intelligence - Merge Installer")
print("=" * 40)

# The rebuild files are embedded as base64
# This script will extract them into the current directory
PAYLOAD = ""

print("\nThis will add the following NEW files:")
print("  eugene/config.py           - Configuration management")
print("  eugene/sources/edgar.py    - Real SEC EDGAR client")
print("  eugene/extraction/llm.py   - LLM extraction engine")
print("  eugene/models/base.py      - Data models with validation")
print("  eugene/validation/engine.py - Trust & verification layer")
print("  eugene/extraction/parsers/employees.py - Layoff tracker")
print("  test_architecture.py       - Test suite")
print("  requirements.txt           - Updated dependencies")
print("  README.md                  - Updated README")
print("\nThis will REPLACE:")
print("  api/main.py                - New FastAPI with real endpoints")
print("  mcp/server.py              - New MCP server with 5 tools")
print("\nYour existing parsers and agents are NOT touched.")

resp = input("\nProceed? [y/N]: ").strip().lower()
if resp != 'y':
    print("Aborted.")
    sys.exit(0)

# Decode and extract
data = base64.b64decode(PAYLOAD)
buf = io.BytesIO(data)
with tarfile.open(fileobj=buf, mode='r:gz') as tar:
    tar.extractall(".")

# Create .env.example if it doesn't exist
if not os.path.exists(".env.example"):
    with open(".env.example", "w") as f:
        f.write("""# Required
ANTHROPIC_API_KEY=sk-ant-your-key-here

# SEC EDGAR (required)
SEC_CONTACT_EMAIL=your-email@example.com
SEC_CONTACT_NAME=Eugene Intelligence

# Optional
EUGENE_LOG_LEVEL=INFO
EUGENE_CACHE_DIR=./data/cache
""")
    print("Created .env.example")

print("\nâœ… Merge complete!")
print("\nNext steps:")
print("  1. cp .env.example .env")
print("  2. Edit .env and add your ANTHROPIC_API_KEY")
print("  3. python3 test_architecture.py")
